import { version } from './../../constants/version';

export default function GlobalFootter() {
    const d = new Date();
    const year = d.getFullYear();
    return (
    <span style={{color: '#fff'}}>Ao Nguyen Â©{year} Created by Ao Nguyen, v{version[version.length]}</span>
    )
}
